import React from "react";
import Sdata from "./Sdata";
import Netflix from "./Netflix";

const Dark = () =>{
    return(
        <Netflix 
imgsrc = {Sdata[0].imgsrc}
title = {Sdata[0].title}
sname = {Sdata[0].sname}
link = {Sdata[0].link}
/>
    );
};

export default Dark;
